"use strict";(self.webpackChunkvoice_2_post_doc=self.webpackChunkvoice_2_post_doc||[]).push([[6664],{503:(e,t,n)=>{n.r(t),n.d(t,{assets:()=>l,contentTitle:()=>r,default:()=>d,frontMatter:()=>a,metadata:()=>o,toc:()=>u});var s=n(4848),i=n(8453);const a={id:"mktg-presentation",title:"Presentation",hide_table_of_contents:!1,description:"What is Veep?",keywords:["marketing","presentation"],tags:["marketing","presentation"],last_update:{date:"10/27/2024",author:"Jean-Christophe Kermagoret"}},r="Introduction",o={id:"marketing/mktg-presentation",title:"Presentation",description:"What is Veep?",source:"@site/docs/marketing/presentation.md",sourceDirName:"marketing",slug:"/marketing/mktg-presentation",permalink:"/marketing/mktg-presentation",draft:!1,unlisted:!1,tags:[{inline:!0,label:"marketing",permalink:"/tags/marketing"},{inline:!0,label:"presentation",permalink:"/tags/presentation"}],version:"current",frontMatter:{id:"mktg-presentation",title:"Presentation",hide_table_of_contents:!1,description:"What is Veep?",keywords:["marketing","presentation"],tags:["marketing","presentation"],last_update:{date:"10/27/2024",author:"Jean-Christophe Kermagoret"}},sidebar:"tutorialSidebar",previous:{title:"Features",permalink:"/features"},next:{title:"Screenshots",permalink:"/marketing/mktg-screenshots"}},l={},u=[{value:"L&#39;importance de la contextualisation de l&#39;IA",id:"limportance-de-la-contextualisation-de-lia",level:2},{value:"La mise en place du contexte",id:"la-mise-en-place-du-contexte",level:2},{value:"Pr\xe9sentation du catalogue d&#39;assistants",id:"pr\xe9sentation-du-catalogue-dassistants",level:2},{value:"Exploration des diff\xe9rents assistants IA disponibles",id:"exploration-des-diff\xe9rents-assistants-ia-disponibles",level:3},{value:"Utilisation des assistants pour la cr\xe9ation de contenu",id:"utilisation-des-assistants-pour-la-cr\xe9ation-de-contenu",level:2},{value:"Discussion sur les capacit\xe9s de cr\xe9ation, d&#39;\xe9dition de contenu et de documents",id:"discussion-sur-les-capacit\xe9s-de-cr\xe9ation-d\xe9dition-de-contenu-et-de-documents",level:3},{value:"Fonctionnalit\xe9s li\xe9es \xe0 l&#39;exportation",id:"fonctionnalit\xe9s-li\xe9es-\xe0-lexportation",level:2},{value:"Les options disponibles pour la publication de contenu marketing et communicationnelle",id:"les-options-disponibles-pour-la-publication-de-contenu-marketing-et-communicationnelle",level:3},{value:"La cr\xe9ation de documents professionnels",id:"la-cr\xe9ation-de-documents-professionnels",level:3},{value:"Int\xe9gration avec les r\xe9seaux sociaux et autres plateformes",id:"int\xe9gration-avec-les-r\xe9seaux-sociaux-et-autres-plateformes",level:2},{value:"Les possibilit\xe9s d&#39;exportation directe",id:"les-possibilit\xe9s-dexportation-directe",level:3}];function c(e){const t={h1:"h1",h2:"h2",h3:"h3",header:"header",li:"li",p:"p",ul:"ul",...(0,i.R)(),...e.components};return(0,s.jsxs)(s.Fragment,{children:[(0,s.jsx)(t.header,{children:(0,s.jsx)(t.h1,{id:"introduction",children:"Introduction"})}),"\n",(0,s.jsx)(t.p,{children:"Dans le monde en constante \xe9volution des affaires, o\xf9 l'efficacit\xe9 et la productivit\xe9 sont au c\u0153ur des pr\xe9occupations, l'intelligence artificielle (IA) se pr\xe9sente comme une solution r\xe9volutionnaire. La plateforme Veep.AI incarne cette innovation en offrant un ensemble d'outils bas\xe9s sur l'IA con\xe7us pour transformer les op\xe9rations des entreprises, des organisations et m\xeame des projets individuels. Avec son approche unique divis\xe9e en quatre segments principaux, Veep.AI vise \xe0 faciliter l'int\xe9gration de l'intelligence artificielle dans divers aspects de l'activit\xe9 professionnelle, allant de la personnalisation de l'assistance IA \xe0 la cr\xe9ation et \xe0 l'exportation de contenu. Disponible sous forme de logiciel open source sur GitHub pour les techniciens avertis et en version SAS pour ceux qui pr\xe9f\xe8rent \xe9viter les complexit\xe9s techniques, Veep.AI offre une flexibilit\xe9 sans pr\xe9c\xe9dent pour r\xe9pondre aux besoins vari\xe9s de ses utilisateurs."}),"\n",(0,s.jsx)(t.p,{children:"\xc0 travers ce guide, nous explorerons en d\xe9tail les diff\xe9rentes facettes de Veep.AI, en commen\xe7ant par l'importance cruciale de d\xe9finir un contexte d'utilisation de l'IA, suivi par la d\xe9couverte du catalogue d'assistants IA et des outils de cr\xe9ation de contenu. Nous aborderons \xe9galement les fonctionnalit\xe9s li\xe9es \xe0 l'exportation et \xe0 la publication de contenu, soulignant comment Veep.AI peut servir de tremplin pour optimiser la productivit\xe9 et l'efficacit\xe9 au sein de votre entreprise ou projet."}),"\n",(0,s.jsx)(t.p,{children:"Alors, comment Veep.AI peut-il s'int\xe9grer sp\xe9cifiquement dans votre environnement professionnel pour am\xe9liorer les processus et les r\xe9sultats ? Quelles sont les \xe9tapes \xe0 suivre pour exploiter pleinement le potentiel de cette plateforme IA dans votre organisation ? Suivez-nous dans les chapitres suivants pour d\xe9couvrir comment Veep.AI peut transformer votre approche de la productivit\xe9 gr\xe2ce \xe0 l'intelligence artificielle."}),"\n",(0,s.jsx)(t.h1,{id:"d\xe9finition-du-contexte-dutilisation-de-lia",children:"D\xe9finition du contexte d'utilisation de l'IA"}),"\n",(0,s.jsx)(t.p,{children:"La mise en \u0153uvre r\xe9ussie de l'intelligence artificielle (IA) au sein des entreprises et des organisations repose sur une \xe9tape fondamentale : la d\xe9finition pr\xe9cise du contexte d'utilisation de l'IA. Cet aspect crucial assure que l'IA, agissant comme un assistant virtuel, soit parfaitement align\xe9e avec les besoins sp\xe9cifiques, les objectifs et les processus de chaque entit\xe9. Dans ce chapitre, nous explorerons l'importance de contextualiser l'IA pour maximiser son efficacit\xe9 et d\xe9taillerons les m\xe9thodes permettant de cr\xe9er un environnement propice \xe0 son int\xe9gration."}),"\n",(0,s.jsx)(t.h2,{id:"limportance-de-la-contextualisation-de-lia",children:"L'importance de la contextualisation de l'IA"}),"\n",(0,s.jsx)(t.p,{children:"La n\xe9cessit\xe9 de personnaliser l'IA pour qu'elle r\xe9ponde efficacement aux besoins sp\xe9cifiques de chaque entreprise."}),"\n",(0,s.jsx)(t.p,{children:"L'intelligence artificielle, sans une compr\xe9hension approfondie du contexte dans lequel elle est d\xe9ploy\xe9e, risque de ne pas atteindre son plein potentiel. La personnalisation de l'IA est donc une d\xe9marche essentielle pour s'assurer qu'elle fonctionne comme un assistant v\xe9ritablement efficace, capable de r\xe9pondre avec pertinence et pr\xe9cision aux diverses exigences d'une entreprise. Cette personnalisation commence par une \xe9tape de contextualisation, au cours de laquelle les param\xe8tres, les objectifs et les particularit\xe9s de l'environnement d'affaires sont clairement d\xe9finis. Ce processus garantit que l'IA peut non seulement comprendre les sp\xe9cificit\xe9s de l'entreprise mais aussi agir de mani\xe8re optimale en fonction de celles-ci."}),"\n",(0,s.jsx)(t.h2,{id:"la-mise-en-place-du-contexte",children:"La mise en place du contexte"}),"\n",(0,s.jsx)(t.p,{children:"Les m\xe9thodes pour d\xe9finir un contexte favorable \xe0 l'int\xe9gration de l'assistant IA dans l'environnement de l'entreprise."}),"\n",(0,s.jsx)(t.p,{children:"La d\xe9finition d'un contexte favorable \xe0 l'int\xe9gration d'une IA n\xe9cessite une approche m\xe9thodique et r\xe9fl\xe9chie. Les \xe9tapes suivantes sont essentielles pour y parvenir :"}),"\n",(0,s.jsxs)(t.ul,{children:["\n",(0,s.jsx)(t.li,{children:"Analyse des Besoins et Objectifs : Avant tout, il est imp\xe9ratif de r\xe9aliser une analyse compl\xe8te des besoins de l'entreprise ainsi que des objectifs \xe0 atteindre gr\xe2ce \xe0 l'IA. Cette analyse doit couvrir tous les aspects de l'entreprise, des op\xe9rations quotidiennes aux strat\xe9gies \xe0 long terme."}),"\n",(0,s.jsx)(t.li,{children:"Cartographie des Processus : Identifier et documenter les processus op\xe9rationnels existants permet de comprendre o\xf9 et comment l'IA peut apporter une valeur ajout\xe9e. Cela inclut la reconnaissance des t\xe2ches r\xe9p\xe9titives ou des d\xe9cisions bas\xe9es sur des donn\xe9es qui peuvent \xeatre optimis\xe9es par l'IA."}),"\n",(0,s.jsx)(t.li,{children:"D\xe9finition des Donn\xe9es Disponibles : L'IA n\xe9cessite des donn\xe9es pour apprendre et fonctionner efficacement. Il est donc crucial d'\xe9valuer les donn\xe9es disponibles, leur qualit\xe9, leur accessibilit\xe9, et de pr\xe9parer les infrastructures n\xe9cessaires pour leur traitement."}),"\n",(0,s.jsx)(t.li,{children:"\xc9tablissement de Crit\xe8res de Performance : Pour \xe9valuer l'efficacit\xe9 de l'IA, il est important de d\xe9finir des crit\xe8res de performance clairs et mesurables. Ces crit\xe8res aideront \xe0 ajuster et \xe0 optimiser continuellement l'utilisation de l'IA."}),"\n",(0,s.jsx)(t.li,{children:"Formation et Sensibilisation des \xc9quipes : Finalement, il est vital de pr\xe9parer les \xe9quipes \xe0 travailler avec l'IA. Cela implique de les former sur les capacit\xe9s de l'IA, mais aussi de les sensibiliser sur la mani\xe8re de collaborer efficacement avec elle."}),"\n"]}),"\n",(0,s.jsx)(t.p,{children:"En suivant ces \xe9tapes, les entreprises peuvent cr\xe9er un contexte bien d\xe9fini pour l'int\xe9gration de l'IA, ce qui maximisera ses b\xe9n\xe9fices en termes de productivit\xe9 et d'efficacit\xe9. La contextualisation de l'IA n'est pas seulement une \xe9tape technique mais \xe9galement un processus strat\xe9gique qui assure que l'assistant IA est pleinement align\xe9 avec les missions et les visions de l'entreprise."}),"\n",(0,s.jsx)(t.h1,{id:"catalogue-dassistants-ia-et-cr\xe9ation-de-contenu",children:"Catalogue d'assistants IA et cr\xe9ation de contenu"}),"\n",(0,s.jsx)(t.p,{children:"Dans ce chapitre, nous allons explorer le c\u0153ur de la plateforme Veep.AI : son vaste catalogue d'assistants IA con\xe7us pour couvrir tous les besoins fonctionnels d'une entreprise, ainsi que ses capacit\xe9s exceptionnelles en mati\xe8re de cr\xe9ation et d'\xe9dition de contenu. La flexibilit\xe9 et la diversit\xe9 des assistants disponibles permettent une personnalisation pouss\xe9e, assurant ainsi que chaque aspect de l'activit\xe9 de l'entreprise puisse b\xe9n\xe9ficier de l'optimisation par l'intelligence artificielle."}),"\n",(0,s.jsx)(t.h2,{id:"pr\xe9sentation-du-catalogue-dassistants",children:"Pr\xe9sentation du catalogue d'assistants"}),"\n",(0,s.jsx)(t.p,{children:"Veep.AI se distingue par son approche modulaire de l'intelligence artificielle au service des entreprises. Le catalogue d'assistants IA est une composante cl\xe9 de cette plateforme, offrant une vari\xe9t\xe9 d'outils sp\xe9cialis\xe9s destin\xe9s \xe0 am\xe9liorer la productivit\xe9 dans divers domaines fonctionnels. Que ce soit pour l'administration g\xe9n\xe9rale, les ressources humaines, la comptabilit\xe9, les finances, ou encore les secteurs plus directement productifs tels que le d\xe9veloppement, le consulting, ou les fonctions commerciales et de marketing, Veep.AI propose un assistant adapt\xe9 \xe0 chaque besoin."}),"\n",(0,s.jsx)(t.h3,{id:"exploration-des-diff\xe9rents-assistants-ia-disponibles",children:"Exploration des diff\xe9rents assistants IA disponibles"}),"\n",(0,s.jsx)(t.p,{children:"Chaque assistant IA du catalogue a \xe9t\xe9 con\xe7u avec l'objectif de r\xe9pondre aux exigences sp\xe9cifiques de son domaine d'application. Par exemple, dans le domaine des ressources humaines, un assistant peut aider \xe0 automatiser le processus de recrutement, de la r\xe9ception des candidatures \xe0 la pr\xe9s\xe9lection des profils, en passant par l'organisation des entretiens. En comptabilit\xe9, un autre assistant pourrait prendre en charge l'automatisation de la saisie des factures, l'analyse des d\xe9penses et la pr\xe9paration des rapports financiers."}),"\n",(0,s.jsx)(t.p,{children:"La vari\xe9t\xe9 des assistants disponibles assure que chaque secteur d'une organisation puisse trouver dans Veep.AI un outil capable d'am\xe9liorer significativement son efficacit\xe9 et sa pr\xe9cision op\xe9rationnelle."}),"\n",(0,s.jsx)(t.h2,{id:"utilisation-des-assistants-pour-la-cr\xe9ation-de-contenu",children:"Utilisation des assistants pour la cr\xe9ation de contenu"}),"\n",(0,s.jsx)(t.p,{children:"Au-del\xe0 de l'assistance sp\xe9cialis\xe9e, Veep.AI se r\xe9v\xe8le \xeatre un puissant alli\xe9 dans la cr\xe9ation de contenu et de documents. Gr\xe2ce \xe0 ses fonctionnalit\xe9s avanc\xe9es d'\xe9dition, la plateforme permet de produire des \xe9l\xe9ments de haute qualit\xe9, qui auraient traditionnellement requis l'usage de multiples logiciels de traitement de texte et de mise en page."}),"\n",(0,s.jsx)(t.h3,{id:"discussion-sur-les-capacit\xe9s-de-cr\xe9ation-d\xe9dition-de-contenu-et-de-documents",children:"Discussion sur les capacit\xe9s de cr\xe9ation, d'\xe9dition de contenu et de documents"}),"\n",(0,s.jsx)(t.p,{children:"Les assistants IA de Veep.AI disposent de capacit\xe9s \xe9tendues en mati\xe8re de cr\xe9ation de contenu, permettant \xe0 l'utilisateur de g\xe9n\xe9rer des textes, des rapports, des \xe9tudes de cas et bien plus encore, avec une grande facilit\xe9 et une efficience remarquable. Ces outils peuvent, par exemple, aider \xe0 structurer un document de mani\xe8re logique, sugg\xe9rer des am\xe9liorations stylistiques, ou encore optimiser le contenu pour le SEO dans le cas de documents destin\xe9s au web."}),"\n",(0,s.jsx)(t.p,{children:"La plateforme offre \xe9galement des fonctionnalit\xe9s d'\xe9dition avanc\xe9es, permettant aux utilisateurs de peaufiner leurs documents jusqu'\xe0 atteindre la perfection souhait\xe9e. Que ce soit pour des besoins internes ou pour des publications destin\xe9es \xe0 un large public, Veep.AI met \xe0 disposition tous les outils n\xe9cessaires pour que la cr\xe9ation de contenu devienne non seulement plus efficace, mais aussi plus engageante et impactante."}),"\n",(0,s.jsx)(t.h1,{id:"exportation-et-publication-de-contenu",children:"Exportation et publication de contenu"}),"\n",(0,s.jsx)(t.p,{children:"Dans un environnement professionnel o\xf9 le contenu num\xe9rique r\xe8gne en ma\xeetre, la capacit\xe9 d'exporter et de publier efficacement ce contenu est cruciale pour toute entreprise souhaitant maintenir une pr\xe9sence pertinente et engageante sur le march\xe9. Le chapitre suivant explore les fonctionnalit\xe9s avanc\xe9es de la plateforme Veep.AI, sp\xe9cifiquement con\xe7ues pour transformer le contenu cr\xe9atif en communications professionnelles pr\xeates \xe0 \xeatre partag\xe9es avec le monde."}),"\n",(0,s.jsx)(t.h2,{id:"fonctionnalit\xe9s-li\xe9es-\xe0-lexportation",children:"Fonctionnalit\xe9s li\xe9es \xe0 l'exportation"}),"\n",(0,s.jsx)(t.p,{children:"La plateforme Veep.AI r\xe9volutionne le processus d'exportation de contenu en proposant des outils intuitifs et polyvalents adapt\xe9s aux exigences modernes des entreprises. Que ce soit pour publier des articles de blog captivants, partager des mises \xe0 jour importantes avec votre audience sur les r\xe9seaux sociaux, ou g\xe9n\xe9rer des rapports professionnels et des \xe9tudes de cas, Veep.AI offre une suite compl\xe8te d'options d'exportation."}),"\n",(0,s.jsx)(t.h3,{id:"les-options-disponibles-pour-la-publication-de-contenu-marketing-et-communicationnelle",children:"Les options disponibles pour la publication de contenu marketing et communicationnelle"}),"\n",(0,s.jsx)(t.p,{children:"Dans une \xe8re domin\xe9e par le contenu digital, Veep.AI se dresse comme un pilier central pour les strat\xe9gies de marketing et de communication. La plateforme permet non seulement la cr\xe9ation de contenu riche et engageant gr\xe2ce \xe0 ses assistants IA, mais facilite \xe9galement sa publication. Les utilisateurs peuvent ainsi directement exporter leur contenu vers des formats web optimis\xe9s pour le SEO, ou encore sous forme de newsletters soigneusement \xe9labor\xe9es pour captiver leur public cible."}),"\n",(0,s.jsx)(t.h3,{id:"la-cr\xe9ation-de-documents-professionnels",children:"La cr\xe9ation de documents professionnels"}),"\n",(0,s.jsx)(t.p,{children:"Veep.AI transcende les attentes en offrant des capacit\xe9s avanc\xe9es de g\xe9n\xe9ration de documents professionnels. Qu'il s'agisse de rapports d\xe9taill\xe9s, d'\xe9tudes de cas approfondies, ou de propositions de subvention convaincantes, la plateforme permet de transformer des donn\xe9es complexes et des id\xe9es en documents structur\xe9s et visuellement attrayants. Les utilisateurs peuvent exporter ces documents en formats PDF ou DOCX, assurant ainsi une compatibilit\xe9 \xe9tendue et une pr\xe9sentation impeccable."}),"\n",(0,s.jsx)(t.h2,{id:"int\xe9gration-avec-les-r\xe9seaux-sociaux-et-autres-plateformes",children:"Int\xe9gration avec les r\xe9seaux sociaux et autres plateformes"}),"\n",(0,s.jsx)(t.p,{children:"Dans le paysage num\xe9rique actuel, la capacit\xe9 \xe0 diffuser rapidement et efficacement du contenu \xe0 travers diverses plateformes sociales est un atout incontestable. Veep.AI int\xe8gre des fonctions d'exportation directe vers des plateformes comme LinkedIn, Instagram, TikTok et Facebook, permettant aux entreprises de maintenir une interaction constante et dynamique avec leur audience."}),"\n",(0,s.jsx)(t.h3,{id:"les-possibilit\xe9s-dexportation-directe",children:"Les possibilit\xe9s d'exportation directe"}),"\n",(0,s.jsx)(t.p,{children:"Avec Veep.AI, l'exportation de contenu vers les r\xe9seaux sociaux et autres plateformes num\xe9riques devient un jeu d'enfant. Cette int\xe9gration fluide garantit que le contenu, qu'il s'agisse d'annonces marketing, de mises \xe0 jour de projet, ou de contenu \xe9ducatif, atteint son public cible avec une efficacit\xe9 maximale. Les utilisateurs b\xe9n\xe9ficient d'une diffusion sans effort de leur message, renfor\xe7ant ainsi leur visibilit\xe9 et leur engagement aupr\xe8s de leur communaut\xe9 en ligne."}),"\n",(0,s.jsx)(t.h1,{id:"conclusion",children:"Conclusion"}),"\n",(0,s.jsx)(t.p,{children:"La plateforme Veep.AI se positionne \xe0 l'avant-garde de l'innovation en mati\xe8re d'intelligence artificielle, offrant une solution compl\xe8te pour int\xe9grer l'IA dans divers aspects des op\xe9rations d'entreprise. En naviguant \xe0 travers ses quatre segments principaux - d\xe9finition du contexte, catalogue d'assistants IA, cr\xe9ation et \xe9dition de contenu, ainsi que l'exportation et la publication - il devient \xe9vident que Veep.AI a le potentiel de transformer radicalement la mani\xe8re dont les entreprises abordent la productivit\xe9 et l'efficience."}),"\n",(0,s.jsx)(t.p,{children:"Cependant, l'adoption de telles technologies soul\xe8ve \xe9galement des questions plus larges sur l'avenir du travail et la place de l'humain dans un environnement de plus en plus automatis\xe9. Alors que Veep.AI et d'autres outils bas\xe9s sur l'IA promettent d'am\xe9liorer l'efficacit\xe9 et de lib\xe9rer les employ\xe9s des t\xe2ches r\xe9p\xe9titives, il est essentiel de se demander comment ces technologies affecteront l'emploi, les comp\xe9tences requises pour le march\xe9 du travail futur, et comment elles peuvent \xeatre d\xe9ploy\xe9es de mani\xe8re \xe9thique et responsable."}),"\n",(0,s.jsx)(t.p,{children:"La transformation num\xe9rique, acc\xe9l\xe9r\xe9e par des plateformes comme Veep.AI, pousse les organisations \xe0 repenser non seulement leurs processus internes mais aussi leur culture d'entreprise, leur strat\xe9gie en mati\xe8re de talents et leur approche de la formation continue. L'int\xe9gration de l'IA dans les op\xe9rations quotidiennes n\xe9cessite une compr\xe9hension profonde non seulement de la technologie elle-m\xeame, mais aussi de son impact potentiel sur la dynamique d'\xe9quipe, la prise de d\xe9cision et la strat\xe9gie globale de l'entreprise."}),"\n",(0,s.jsx)(t.p,{children:"Enfin, alors que nous embrassons le potentiel de l'IA pour remodeler le paysage professionnel, il est crucial de maintenir un dialogue ouvert sur les implications \xe9thiques de son utilisation. Cela comprend la protection de la vie priv\xe9e, la transparence des algorithmes et la pr\xe9vention des biais, assurant que l'IA sert \xe0 enrichir la soci\xe9t\xe9 plut\xf4t qu'\xe0 exacerber les in\xe9galit\xe9s existantes."}),"\n",(0,s.jsx)(t.p,{children:"Veep.AI repr\xe9sente une avanc\xe9e significative dans la mani\xe8re dont l'IA peut \xeatre utilis\xe9e pour am\xe9liorer la productivit\xe9 et l'efficacit\xe9 au sein des organisations. Toutefois, son adoption soul\xe8ve des questions importantes sur l'avenir du travail, l'\xe9thique de l'IA et la n\xe9cessit\xe9 d'une approche holistique qui consid\xe8re les impacts humains et sociaux de cette technologie disruptive. En continuant \xe0 explorer ces technologies, il est imp\xe9ratif de rester attentifs \xe0 ces probl\xe9matiques pour assurer que l'avancement technologique s'aligne avec des principes \xe9thiques solides et favorise le bien-\xeatre collectif."})]})}function d(e={}){const{wrapper:t}={...(0,i.R)(),...e.components};return t?(0,s.jsx)(t,{...e,children:(0,s.jsx)(c,{...e})}):c(e)}},8453:(e,t,n)=>{n.d(t,{R:()=>r,x:()=>o});var s=n(6540);const i={},a=s.createContext(i);function r(e){const t=s.useContext(a);return s.useMemo((function(){return"function"==typeof e?e(t):{...t,...e}}),[t,e])}function o(e){let t;return t=e.disableParentContext?"function"==typeof e.components?e.components(i):e.components||i:r(e.components),s.createElement(a.Provider,{value:t},e.children)}}}]);